window.onload = function(){

    'use strict';

    var
        // satisfy jslint
        sequencer = window.sequencer,
        console = window.console,
        btnLoad = document.getElementById('load'),
        selectAction = document.getElementById('action'),
        divConsole = document.getElementById('console'),

        /*
            "default"       will just return 'false' when you try to load a sample pack to a location
                            in the storage where already a sample pack is stored

            "append"        appends samples to an existing sample pack

            "overwrite"     replaces the existing sample pack by the new one
        */

        action = 'default';


    sequencer.addSamplePack({
        name: 'piano',
        folder: 'instruments',
        mapping:
        {
            A0:'',
            Bb0:'',
            B0:'',
            C1:''
        }
    }, printLoadedSamples);



    btnLoad.addEventListener('click', function(){
        sequencer.addSamplePack({
            name: 'piano',
            folder: 'instruments',
            action: action,
            mapping: {
                Db1:'',
                D1:'',
                Eb1:'',
                E1:'',
                F1:'',
                Gb1:''
            }
        }, printLoadedSamples);
    });


    selectAction.addEventListener('change', function(){
        action = selectAction.options[selectAction.selectedIndex].innerHTML;
    },false);


    function printLoadedSamples(){
        var samples = sequencer.getSamples('instruments');

        divConsole.innerHTML = '';

        samples.forEach(function(sample){
            divConsole.innerHTML += sample.name + '<br/>';
        });

        console.log(sequencer.storage);
    }

};